import axios from "axios";
import React from "react";
import { useEffect, useState } from "react";
import { GetItem } from "../actions/user";
import { config } from "../api/config";
import { connect } from "react-redux";
const UserProfile = ({UserProfile}) => {
  const [data, setData] = useState([]);

  const token = localStorage.getItem('token');
  console.log("dfjd",token);
  useEffect(() => {
    axios
      .get(config.USER_PROFILE , {headers: {"Authorization" : `Bearer ${token}`}})

      .then((res) => {
        console.log("result=======>", res);
        setData(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  UserProfile(data);
  return (
    <div>
        <h1>Profile Page</h1>
      <ul>
        {data.map((data) => (
          <div className="container">
            <div
              className="row"
              style={{ backgroundColor: "lightblue", marginBottom: "30px" }}
            >
              <h2>Item Details:</h2>
              <li key={data.name}>Name : {data.name}</li>
              {/* <li key={data.address}>Address : {data.address}</li> */}
              <li key={data.city}>City : {data.city}</li>
            </div>
          </div>
        ))}
      </ul>
    </div>
  );
};

const mapDispatchToProps = (dispatch) => {
  return {
    UserProfile: (addItemData) => dispatch(UserProfile(addItemData)),
  };
};
const itemStore = connect(null, mapDispatchToProps)(UserProfile);
export default itemStore;
